;; **
;;; Define parameters and train the neural network.
;; **

;; @@
(def hidden-layers [100 60])
(def alpha 0.1)
(def lambda 0.00001)
(def partitions 10)
(def iterations 100)

(def training-set train-data)
(def validation (take-last 2000 train-data))

(defn train-neural-network
  [model data parts iters]
  (loop [partitions (->> (partition (/ (count data) parts) data)
                         (repeat iters)
                         (apply concat))
         model model
         stats []]
    (if (empty? partitions)
      [model stats]
      (let [model (neural-network-fit model (first partitions))
            tcost (neural-network-cost model (first partitions))
            vcost (neural-network-cost model validation)
            accuracy (accuracy model validation)
            norm (ml/norm (:parameters model))]
        (println "partition" (count partitions) "tcost" tcost "vcost" vcost "accuracy" accuracy "norm" norm)
        (recur (rest partitions) model (conj stats [tcost vcost accuracy norm]))))))

(def output
  (let [model (nnv/make-neural-network hidden-layers alpha lambda)
        [model stats] (train-neural-network model training-set partitions iterations)]
    (println "final accuracy" (accuracy model validation))
    [model
     ;; Plot training and validation costs
     (let [c (concat (map first stats) (map second stats))
           yrange [(apply min c) (apply max c)]]
       (plot/compose (plot/list-plot (map first stats) :color "red" :joined true :plot-range [:all yrange])
                     (plot/list-plot (map second stats) :color "green" :joined true :plot-range [:all yrange])))

     ;; Plot accuracy and norms
     (plot/list-plot (map #(nth % 2) stats) :joined true :plot-range [:all [0.9 1.0]])
     (plot/list-plot (map #(nth % 3) stats) :joined true)]))

(def nn (first output))
(nth output 1)
(nth output 2)
(nth output 3)
