;; **
;;; Visualize the first hidden layer.
;; **

;; @@
(def hi (apply max (map #(apply max %) (first (:parameters nn)))))
(def lo (apply min (map #(apply min %) (first (:parameters nn)))))

(map #(-> (partition 28 (map (fn [x] (/ (- x lo) (- hi lo))) (rest %)))
          (pixels->image)
          (image/image-view :width 64))
     (first (:parameters nn)))
;; @@

;; **
;;; Output the predictions on the test data.
;; **

;; @@
(write-output alpha
              lambda
              hidden-layers
              iterations
              (map-indexed vector (neural-network-predict nn test-data)))
